import { Component } from '@angular/core';

@Component({
  selector: 'app-menu-presentacion',
  templateUrl: './menu-presentacion.component.html',
  styleUrls: ['./menu-presentacion.component.css']
})
export class MenuPresentacionComponent {
listaMenu:any[]=[]
ngOnInit(){
  this.listaMenu=[
    {icono:'fa..',titulo:'Home',ruta:'',seleccionado:''},
    {icono:'fa..',titulo:'Tablas Amortizacion',ruta:'',seleccionado:''},
    {icono:'fa..',titulo:'Contacto',ruta:'',seleccionado:''},
    {icono:'fa..',titulo:'Acceso',ruta:'',seleccionado:''}
  ]
}
}
<div class="content">
    <app-menu-item-presentacion class="item" *ngFor="let row of listaMenu" [item]="row"></app-menu-item-presentacion>
</div>
